import { Button, Box, Typography } from "@mui/material";
import videoBg from "../homePage/assets/videoBg.mp4";

const MainPage = () => {
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);
  const [quizFeedback, setQuizFeedback] = useState("");
  const [quizCompleted, setQuizCompleted] = useState(false);

  const questions = [
    {
      question:
        "–ö—Ç–æ –∏–∑ —Å–ø–æ—Ä—Ç—Å–º–µ–Ω–æ–≤ –ö—ã—Ä–≥—ã–∑—Å—Ç–∞–Ω–∞ —Å—Ç–∞–ª –æ–ª–∏–º–ø–∏–π—Å–∫–∏–º —á–µ–º–ø–∏–æ–Ω–æ–º –≤ –¢–æ–∫–∏–æ?",
      options: [
        "–ì—É–ª—å–Ω–∞—Ä–∞ –ë–µ–∫–º–∞–º–∞—Ç–æ–≤–∞",
        "–ú–µ–¥–µ—Ç –°–∞–π–¥—É–ª–∞–µ–≤",
        "–£–ª–∞–Ω–±–µ–∫ –ê–º–∏—Ä–æ–≤",
        "–°–∞–∏–¥–∂–æ–Ω –ú–∞–¥–∞–ª–∏–µ–≤",
      ],
      correct: 0,
    },
    {
      question:
        "–ö–∞–∫–æ–π –≤–∏–¥ —Å–ø–æ—Ä—Ç–∞ –ø—Ä–∏–Ω–µ—Å –ö—ã—Ä–≥—ã–∑—Å—Ç–∞–Ω—É –ø–µ—Ä–≤—É—é –æ–ª–∏–º–ø–∏–π—Å–∫—É—é –º–µ–¥–∞–ª—å?",
      options: ["–ë–æ–∫—Å", "–ë–æ—Ä—å–±–∞", "–î–∑—é–¥–æ", "–õ–µ–≥–∫–∞—è –∞—Ç–ª–µ—Ç–∏–∫–∞"],
      correct: 1,
    },
    {
      question:
        "–°–∫–æ–ª—å–∫–æ –º–µ–¥–∞–ª–µ–π –∑–∞–≤–æ–µ–≤–∞–ª–∏ —Å–ø–æ—Ä—Ç—Å–º–µ–Ω—ã –ö—ã—Ä–≥—ã–∑—Å—Ç–∞–Ω–∞ –Ω–∞ –û–ª–∏–º–ø–∏–∞–¥–µ 2016 –≥–æ–¥–∞?",
      options: ["1 –º–µ–¥–∞–ª—å", "2 –º–µ–¥–∞–ª–∏", "3 –º–µ–¥–∞–ª–∏", "4 –º–µ–¥–∞–ª–∏"],
      correct: 1,
    },
  ];

  const handleOptionClick = (index) => {
    if (index === questions[currentQuestionIndex].correct) {
      setQuizFeedback("–ü—Ä–∞–≤–∏–ª—å–Ω—ã–π –æ—Ç–≤–µ—Ç! ‚úÖ");
    } else {
      setQuizFeedback("–ù–µ–ø—Ä–∞–≤–∏–ª—å–Ω—ã–π –æ—Ç–≤–µ—Ç. ‚ùå");
    }
    setTimeout(() => {
      if (currentQuestionIndex < questions.length - 1) {
        setCurrentQuestionIndex(currentQuestionIndex + 1);
        setQuizFeedback("");
      } else {
        setQuizCompleted(true);
      }
    }, 1500);
  };

  return (
    <Box
      sx={{
        position: "relative",
        minHeight: "100vh",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        backgroundColor: "#121212",
        color: "white",
        padding: "20px",
      }}
    >
      <video
        src={videoBg}
        autoPlay
        loop
        muted
        playsInline
        style={{
          position: "absolute",
          top: 0,
          left: 0,
          width: "100%",
          height: "100%",
          objectFit: "cover",
          filter: "brightness(50%)",
          zIndex: -1,
        }}
      />

      <Typography
        variant="h2"
        sx={{ marginBottom: "20px", fontWeight: "bold" }}
      >
        –û–ª–∏–º–ø–∏–π—Å–∫–∞—è –í–∏–∫—Ç–æ—Ä–∏–Ω–∞
      </Typography>

      {!quizCompleted ? (
        <Box
          sx={{
            textAlign: "center",
            backgroundColor: "rgba(255, 255, 255, 0.1)",
            padding: "30px",
            borderRadius: "12px",
            boxShadow: "0 4px 10px rgba(255, 255, 255, 0.1)",
          }}
        >
          <Typography variant="h5" sx={{ marginBottom: "20px" }}>
            {questions[currentQuestionIndex].question}
          </Typography>
          <Box sx={{ display: "flex", flexDirection: "column", gap: "10px" }}>
            {questions[currentQuestionIndex].options.map((option, index) => (
              <Button
                key={index}
                variant="contained"
                color="primary"
                sx={{
                  width: "100%",
                  fontSize: "18px",
                  padding: "12px",
                  transition: "transform 0.2s",
                  "&:hover": { transform: "scale(1.05)" },
                }}
                onClick={() => handleOptionClick(index)}
              >
                {option}
              </Button>
            ))}
          </Box>
          {quizFeedback && (
            <Typography
              sx={{ marginTop: "15px", fontSize: "18px", fontWeight: "bold" }}
            >
              {quizFeedback}
            </Typography>
          )}
        </Box>
      ) : (
        <Typography variant="h4" sx={{ textAlign: "center" }}>
          –í–∏–∫—Ç–æ—Ä–∏–Ω–∞ –∑–∞–≤–µ—Ä—à–µ–Ω–∞! üéâ
        </Typography>
      )}
    </Box>
  );
};

export default MainPage;

